import React from 'react';
import ReactDOM from 'react-dom';

const date = new Date();
const hour = date.getHours();
console.log(hour);

let greet = "";

if (hour >= 0 && hour < 12) {
  greet = "Good morning";
} else if (hour >= 12 && hour < 18) {
  greet = "Good afternoon";
} else {
  greet = "Good evening";
}

const headingStyle = {
  color: hour < 12 ? 'red' : (hour < 18 ? 'green' : 'blue'),
};

ReactDOM.render(
  <div>
    <h1>{greet}</h1>
  </div>,
  document.getElementById("root")
);
